window.bookSummaryJSON = "<p><b>The dungeon has become too small to contain their power.</b></p> <p>Jay and the others are aware of the fact that they are on a ship the size of the moon. More than that they know, they are the last survivors of Earth. They have to round up the rest of the clusters and build their power further and burst out of this prison.</p> <p>Follow Jay as he learns to embrace the power he has but, more importantly, the power of fusion, where the whole is greater than the sum of the parts.&nbsp;</p> <p><b><i>Bursting Out</i></b><b> contains detailed adult activities and unconventional relationships.</b></p>"; 
